def Evolve(M, n):
    #Test si il le compteur de tours est nul
    if n == 0:
        #Ferme l'affichage
        plt.close('all')
        return

    #Trouve la longeur et largeur de la matrice car elle peut être rectangle
    l = len(M[0])
    L = len(M)

    #La matrice de la génération suivante
    M2 = []

    #Ajout de lignes pour éviter les erreurs lors des futurs ajouts
    for k in range (L):
        M2.append([])

    #Double boucle "pour" pour balayer la matrice de long en large
    for Largeur in range (L):
        for longueur in range (l):

            #Compteur de voisin
            c = 0

            #Compte des voisins sur le bloc de 9 case centré sur la case étudiée
            for i in range (3):
                for j in range (3):

                    #Si la case regardé n'est pas la case centrale
                    if not (i == 1 and j == 1):
                        #Vérification pour évité de calculer hors bordure
                        if ((Largeur-1+i) == -1) or ((longueur-1+j) == -1):
                            pass
                        else:
                            # On essaie d'ajouter sinon on passe à la prochaine
                            #case
                            try:
                                c += M[Largeur-1+i][longueur-1+j]
                            except:
                                pass

            # Place 0 ou 1 en fonction de la cellule et son nombre de voisins
            #et sa position
            if M[Largeur][longueur] == 0:
                if c == 3:
                    M2[Largeur].append(1)
                else:
                    M2[Largeur].append(0)

            else:
                if  c == 2 or c == 3:
                    M2[Largeur].append(1)
                else:
                    M2[Largeur].append(0)

    #Remplace les données du graphique pour "l'animer"
    im.set_array(M2)
    #Temps de pause pour créer une animation
    plt.pause(speed)
    # Lance la prochaine génération sauf si entre M2 et M il n'y a pas de
    #différence pour éviter de consommer des ressources inutiles
    if M2 == M:
        return
    Evolve(M2, n-1)

def launch(sel):
    #Création du graphique
    global im
    im = plt.imshow(sel, cmap='Greys')
    #Pause pour voir le graphique de départ
    plt.pause(2)
    #Lance l'animation
    Evolve(sel, 200)
    plt.close('all')

def hasard():
    #Génére une matrice de 100 par 100 de 0 et 1 randoms
    random = numpy.random.choice([0, 1], size=(100,100), p=[3/4, 1/4]).tolist()
    launch(random)
    plt.pause(5)
    plt.close('all')

def vitesse(x):
    global speed
    if x == 1:
        speed = 0.05
    if x == 2:
        speed = 0.025
    if x == 3:
        speed = 0.0125
    if x == 4:
        speed = 0.00625

